import React from "react";
// nodejs library that concatenates classes
import classNames from "classnames";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";
// import Button from "@material-ui/core/Button";
// @material-ui/icons
import { withStyles} from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
// core components
import Header from "components/Header/Header.js";
import Footer from "components/Footer/Footer.js";
import {Grid} from "@material-ui/core";
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import Button from "components/CustomButtons/Button.js";
// import HeaderLinks from "components/Header/HeaderLinks.js";
import Parallax from "components/Parallax/Parallax.js";
import Card from "components/Card/Card.js";
import CardBody from "components/Card/CardBody.js";
import CardFooter from "components/Card/CardFooter.js"; 
import styles from "assets/jss/material-kit-react/views/landingPage.js";
import { Divider } from "@material-ui/core";

const dashboardRoutes = [];

// const useStyles = makeStyles(styles);
const StyledTableCell = withStyles((theme) => ({
  head: {
    backgroundColor:"#f4a261",
    color: "#6a040f",
  },
  body: {
    fontSize: 14,
    color:"#6a040f",
  },
}))(TableCell);

const StyledTableRow = withStyles((theme) => ({
  root: {
    '&:nth-of-type(odd)': {
      backgroundColor: theme.palette.action.hover,
    },
  },
}))(TableRow);

function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),

];

const useStyles = makeStyles({
  table: {
    minWidth: 700,
    minHeight: '200px',
  },
});

export default function Mega(props) {
  const classes = useStyles();
  const { ...rest } = props;
  return (
    <div>
      <Header
        color="transparent"
        routes={dashboardRoutes}
        // rightLinks={<HeaderLinks />}
        fixed
        changeColorOnScroll={{
          height: 400,
          color: "white"
        }}
        {...rest}
      />
      <Parallax filter image={require("assets/img/megamillions1.jpg")}>
        <div className={classes.container}>
          <GridContainer>
            <GridItem xs={6} sm={6} md={6} style={{height:'60px'}}>
              <h1 className={classes.title} style={{color : "white"}}>Megamillions</h1>
              <br/>
            </GridItem>
          </GridContainer>
        </div>
      </Parallax>
      <div className={classNames(classes.main, classes.mainRaised)} >
        <div>

                <h2  style={{color : "#6a040f"}}>Megamillions Winning Numbers</h2>
                <div style={{color : "#6a040f"}}>
                <h4 style={{color : "#6a040f"}}>Next Drawing: Tomorrow  </h4>
                <h4 style={{color : "#6a040f"}}>Current Est Jackpot: $202,000,000</h4>
                <h4 style={{color : "#6a040f"}}>Cash Value: $157,900,000</h4>
                </div>

            <Divider></Divider>
            <Card style={{background : "#6a040f"}}>
              <CardBody>
                <div>
                    <h1 style={{color : "white"}} >Next Drawing</h1>

                </div>
              </CardBody>
            </Card> 
            <Divider></Divider>
            <Card style={{background: "#6a040f"}}>
              <CardBody>

                <div>
                    <h3 style={{color : "white"}}>Cash Value</h3>
                    </div>
                    </CardBody>
                  </Card>
                  <Card style={{background: "#6a040f"}}>
              <CardBody>
<div>
                    <h3 style={{color : "white"}}>Latest Numbers</h3>
                    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell>Dessert (100g serving)</StyledTableCell>
            <StyledTableCell align="right">Calories</StyledTableCell>
            <StyledTableCell align="right">Fat&nbsp;(g)</StyledTableCell>
            <StyledTableCell align="right">Carbs&nbsp;(g)</StyledTableCell>
            <StyledTableCell align="right">Protein&nbsp;(g)</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <StyledTableRow key={row.name}>
              <StyledTableCell component="th" scope="row">
                {row.name}
              </StyledTableCell>
              <StyledTableCell align="right">{row.calories}</StyledTableCell>
              <StyledTableCell align="right">{row.fat}</StyledTableCell>
              <StyledTableCell align="right">{row.carbs}</StyledTableCell>
              <StyledTableCell align="right">{row.protein}</StyledTableCell>
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
                    </div>
     </CardBody>
     </Card>
     <Card style={{background: "#6a040f", alignItems:"center"}}>
       <CardBody>

                    <Button style={{backgroundColor : "#f4a261"}}>Past Winning Numbers</Button>
                    <Button style={{backgroundColor : "#f4a261"}}>Prizes and ODDS</Button>


                    </CardBody>
                    </Card>
        </div>
      </div>
      <Footer/>
    </div>
  );
}
